import { Cover, Mask,Welcome } from './styleComps';

function Home() {
    return (<div>
        <Cover src="https://static.yancey.app/kobebryant.jpg?x-oss-process=image/format,webp">
            <Mask>
                <Welcome></Welcome>
            </Mask>
        </Cover>
    </div>)
}

export default Home;
